import React from "react";
import "../welcome/Welcome.css";
import Logo from '../images/logo1.jpg';
import babyname from '../images/baby-name-finder.png';
import ovulation from '../images/baby-name-finder.png';
import growth from '../images/baby-name-finder.png';

import $ from 'jquery';
import Slider from "react-slick";


function initSlider(){
    $('.logo-area').slick({
        dots: false,
        // infinite: true,
        speed: 300,
        slidesToShow: 6,
        slidesToScroll:1,
        autoplay: true,
        pauseOnDotsHover: false,
    });
}

$(document).on('ready', function () {
    initSlider();
});




function Welcome() {
    return (
        <div>

 <section className="section">
     <div className="container">
         <div className="row">
             <div className="col-md-12 text-center">
             <img src={Logo} alt="logo" width="150" height="100"/>
                 <h3 className="main-heading">Welcome to Our Website</h3>
                 <h5 className="sub">Supporting Your Pregnancy Journey</h5>
                 <p className="para">From conception through birth and all the 
                 wonderful in-betweens, <br/>our nurses and pregnancy educators are 
                 here to provide the resources and information <br/>you need for the 
                 healthiest possible <br/>pregnancy.</p>
                 <div className="underline mx-auto">   
                 </div>

                 <h3 className="main-heading">How can we help?</h3>

                 <div className="client-area">
                     <div className="container">
                         <section className="logo-area slider">
                             <div className="slide"><img src={babyname} alt=""/></div>
                             <div className="slide"><img src={ovulation} alt=""/></div>
                             <div className="slide"><img src={growth} alt=""/></div>
                             <div className="slide"><img src={growth} alt=""/></div>
                             <div className="slide"><img src={growth} alt=""/></div>
                         </section>
                     </div>
                 </div>
             </div>
         </div>
     </div>

 </section>
 </div>
    );
}

export default Welcome;
